exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`http://www.acg.gg/manhua/comic/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/id="dmlink"/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"},reverse:!0})};